// src/pages/ViewInventories.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ViewInventories = () => {
  const [inventories, setInventories] = useState([]);

  useEffect(() => {
    const fetchInventories = async () => {
      const response = await axios.get('http://localhost:4000/api/inventories');
      setInventories(response.data);
    };
    fetchInventories();
  }, []);

  return (
    <div>
      <h1>Inventories</h1>
      <ul>
        {inventories.map(inventory => (
          <li key={inventory._id}>{inventory.itemName} - {inventory.quantity} ({inventory.location}) - ${inventory.price} - {inventory.description}</li>
        ))}
      </ul>
    </div>
  );
};

export default ViewInventories;
